package com.mzbr.videoeditingservice.model;import java.util.List;import javax.persistence.Entity;import javax.persistence.FetchType;import javax.persistence.GeneratedValue;import javax.persistence.GenerationType;import javax.persistence.Id;import javax.persistence.NamedAttributeNode;import javax.persistence.NamedEntityGraph;import javax.persistence.NamedSubgraph;import javax.persistence.OneToMany;import javax.persistence.Table;import jdk.jfr.Name;import lombok.AllArgsConstructor;import lombok.Builder;import lombok.Getter;import lombok.NoArgsConstructor;@Getter@Entity@NoArgsConstructor@AllArgsConstructor@Builder@Table(name = "video")@NamedEntityGraph(name = "VideoEntity.all"	, attributeNodes = {	@NamedAttributeNode(value = "clips", subgraph = "clips.subgraph")},	subgraphs = {		@NamedSubgraph(name = "clips.subgraph", attributeNodes = @NamedAttributeNode("crop"))	})public class VideoEntity {	@Id	@GeneratedValue(strategy = GenerationType.IDENTITY)	Long id;	Integer durationTime;	String thumbnailUrl;	@OneToMany(mappedBy = "videoEntity")	List<Clip> clips;}